  INDEX `ccode`(`ccode`) USING BTREE,
  INDEX `code`(`code`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 6190 CHARACTER SET = utf8 COLLATE = utf8_unicode_ci COMMENT = '所有机场表' ROW_FORMAT = Compact;

