DROP TABLE IF EXISTS `exchange_rate`;
CREATE TABLE `exchange_rate`  (
  `id` bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `source` tinyint(2) NOT NULL DEFAULT 1 COMMENT '1：1G汇率，2:1A汇率，3：中国银行，4浙商银行',
  `currency` varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '基本币',
  `exchange_currency` varchar(3) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '交易币',
  `exchange_unit` int(3) NOT NULL DEFAULT 100 COMMENT '交易币单位 元为单位',
  `central_parity_rate` decimal(18, 8) NULL DEFAULT NULL COMMENT '中间价',
  `forex_sell_rate` decimal(18, 8) NOT NULL COMMENT '现汇卖出价',
  `cash_sell_rate` decimal(18, 8) NULL DEFAULT NULL COMMENT '现钞卖出价',
  `forex_buy_rate` decimal(18, 8) NULL DEFAULT NULL COMMENT '现汇买入价',
  `cash_buy_rate` decimal(18, 8) NULL DEFAULT NULL COMMENT '现钞买入价',
  `update_user_id` bigint(20) UNSIGNED NOT NULL COMMENT '修改人ID',
  `update_time` datetime(0) NULL DEFAULT NULL COMMENT '更新时间',
  `create_user_id` bigint(20) UNSIGNED NOT NULL COMMENT '创建人ID',
  `create_time` datetime(0) NULL DEFAULT NULL COMMENT '创建时间',
  `update_user_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人名称',
  `create_user_name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人名称',
  `status` tinyint(2) NOT NULL DEFAULT 1 COMMENT '0-有效(正常),1-暂停(挂起) 99-无效(删除)',
  PRIMARY KEY (`id`) USING BTREE,
  INDEX `IDX_SER_CURRENCY`(`source`, `currency`, `exchange_currency`) USING BTREE,
  INDEX `IDX_SER_UPDATE_TIME`(`update_time`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 214332 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '实时外汇数据' ROW_FORMAT = Compact;

